import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import ChatApp from './ChatApp';
import Agent from './agent';

const App = () => {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/chat">Chat App</Link>
            </li>
            <li>
              <Link to="/agent">Agent Page</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/chat">
            <ChatApp />
          </Route>
          <Route path="/agent">
            <Agent />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

const Home = () => (
  <div>
    <h2>Home Page</h2>
    {/* Add content for the home page */}
  </div>
);

export default App;
